import React, { useState } from "react";
import { HiChevronDown, HiOutlineUserCircle } from "react-icons/hi";
import {
  MdNotificationsNone,
  MdOutlineDoorBack,
  MdSearch,
} from "react-icons/md";
import { useNavigate } from "react-router-dom";
import api from "../../common/api/api";
import { IChildren } from "../../interface/IChildren";

const Header: React.FC = () => {
  const [toggle, setToggle] = useState(true);
  const showToggle = () => setToggle(!toggle);
  const navigate = useNavigate();
  const fetchLogout = () => {
    api.post("/auth/logout").then((res) => {
      navigate("/login");
    });
  };
  return (
    <div className="absolute top-12 left-0 xl:left-64 flex items-center justify-between right-0 p-2 xl:p-4 text-slate-700 bg-slate-50 text-sm">
      {/* <h1 className='hidden md:block'>
                {children}
            </h1> */}
      <div className="bg-slate-100 mx-8 w-full flex justify-center items-center rounded-2xl">
        <MdSearch className="text-xl xl:text-3xl ml-2" />
        <input
          type="text"
          placeholder="GÃ¶zleg..."
          className="w-full bg-slate-100 focus:outline-none rounded-2xl p-0.5 xl:p-2"
        />
      </div>
      <div>
        <MdNotificationsNone className="text-sm xl:text-3xl" />
      </div>
      <div className="flex items-center">
        <HiOutlineUserCircle className="text-lg xl:text-3xl" />
        <span className="hidden md:block text-center">Admin</span>
      </div>
      <button onClick={showToggle} className="">
        <HiChevronDown size={24} />
      </button>
      <button
        onClick={fetchLogout}
        className={`${
          toggle ? "hidden" : "block"
        } absolute top-16 right-4 rounded-2xl p-2 bg-slate-50 duration-500`}
      >
        <MdOutlineDoorBack size={24} />
      </button>
    </div>
  );
};

export default Header;
